import React from "react";
import { useParams } from "react-router-dom";
import "./TechDetail.css";

const TechDetail = () => {
  const { techName } = useParams();

  return (
    <div className="tech-detail">
      <h2>{techName}</h2>
      <p>
        This page will have all the information about <strong>{techName}</strong>.
      </p>
      <p>Later you can expand with videos, articles, or code samples.</p>
    </div>
  );
};

export default TechDetail;
